  \"Deployable Structural Booms for Large Deployable Solar Arrays Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:11:15.078520\",\n\t\"name\": \"deployable-structural-booms-for-large-deployable-solar-arrays-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The development of a new generation of large,
  high power deployable solar arrays has been identified as the most significant challenge
  facing the development of solar electric propulsion (SEP) systems.  In response,
  innovative solar array structural concepts have been proposed including flexible
  thin-film solar arrays which roll like a carpet for stowage.  These systems are
  simple and reliable while also exhibiting high performance.  Rollable solar arrays
  have not yet reached a high enough technology readiness level (TRL) to be utilized
  as the primary solar array in a high-stakes mission.  The TRL of the current rollable
  solar array systems is hindered by their reliance on a particular manifestation
  of deployable slit-tubes which utilizes an open and unsupported slit and high-performance
  fiber-reinforced polymer (FRP) composite materials.  The FRP slit tubes are high
  performance and ideally suited to the ROSA system, but do not have sufficient test-heritage
  or widely accepted engineering tools to enable reliable and efficient structural
  predictions such as buckling strength or design optimization studies.  A slit-tube
  optimization loop including comprehensive testing and analysis as well as the evaluation
  of novel design features and manufacturing methods is proposed to improve roll out
  solar array technologies being considered for SEP.  The proposed technology will
  result in a library of slit-tube test data with analytical correlation, will increase
  the deployed strength over the state of the art by 4X and increase the state of
  the art TRL.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
